oxy_webhelp_navlinks = {"rsc_settings_menu-d23139e41102":{"topics":[{"title":"<span class=\"ph\">Snapshots<\/span>","shortdesc":"<p class=\"shortdesc\">Snapshots and backup information for relic objects and protected objects appear on         the          <span class=\"ph\">Snapshots<\/span> page.<\/p>","href":"cdm\/snapshot_management_2.html","attributes":{"data-id":"snapshot_management"},"menu":{"hasChildren":false},"tocID":"snapshot_management-d23139e41116","next":"snapshot_management-d23139e41116"},{"title":"Data Sources","shortdesc":"<p class=\"shortdesc\">You can add hosts, instances, and servers for various data-center workloads in the         Data Sources menu. Additionally, you can configure access credentials by setting up Guest OS         settings and SMB security.<\/p>","href":"saas\/data_sources.html","attributes":{"data-id":"data_sources"},"menu":{"hasChildren":false},"tocID":"data_sources-d23139e41313","next":"data_sources-d23139e41313"},{"title":"Cloud Accounts","shortdesc":"<p class=\"shortdesc\">You can add, view, edit, and delete cloud accounts for AWS, Azure, GCP, and Microsoft         Entra ID. Additionally, you can manage Exocompute settings for AWS and Azure.<\/p>","href":"saas\/cloud_accounts.html","attributes":{"data-id":"cloud_accounts"},"menu":{"hasChildren":false},"tocID":"cloud_accounts-d23139e41548","topics":[]},{"title":"Enabling stringent policies for organizations","shortdesc":"<p class=\"shortdesc\">An user with administrator privileges for a global organization can enable global         enforcement settings to enforce stricter policies for tenant organizations.<\/p>","href":"saas\/enabling_stringent_policies_organizations.html","attributes":{"data-id":"enabling_stringent_policies_organizations"},"menu":{"hasChildren":false},"tocID":"enabling_stringent_policies_organizations-d23139e41559","topics":[]},{"title":"Customer Support for <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">You can grant support access and open and close a support tunnel in the Customer         Support menu. The support access feature enables Rubrik Support to access your <span class=\"ph\">RSC<\/span> domain securely in read-only mode. Rubrik Support uses the support         tunnel to examine the health of the Rubrik cluster and to troubleshoot and resolve issues.         You can also run network diagnostics from the Customer Support menu.<\/p>","href":"saas\/customer_support.html","attributes":{"data-id":"customer_support"},"menu":{"hasChildren":false},"tocID":"customer_support-d23139e41570","next":"customer_support-d23139e41570"},{"title":"Managing LLM analysis for <span class=\"ph\">Anomaly Detection<\/span>","shortdesc":"<p class=\"shortdesc\">Manage the use of LLM analysis for <span class=\"ph\">Anomaly Detection<\/span> in <span class=\"ph\">RSC<\/span> by         disabling it when it is not required. To enhance the accuracy of <span class=\"ph\">Anomaly Detection<\/span>,         enable LLM analysis for <span class=\"ph\">Anomaly Detection<\/span>. <\/p>","href":"saas\/managing_llm_analysis_anomaly_detection.html","attributes":{"data-id":"managing_llm_analysis_anomaly_detection"},"menu":{"hasChildren":false},"tocID":"managing_llm_analysis_anomaly_detection-d23139e41616","topics":[]},{"title":"Enabling <span class=\"ph\">Anomaly Detection<\/span>","shortdesc":"<p class=\"shortdesc\">Enable <span class=\"ph\">Anomaly Detection<\/span> to perform behavioral and content analysis on the file         system and show details about potentially anomalous incidents.<\/p>","href":"saas\/enabling_anomaly_detection_2.html","attributes":{"data-id":"enabling_anomaly_detection"},"menu":{"hasChildren":false},"tocID":"enabling_anomaly_detection-d23139e41641","topics":[]}]}};